import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
import { pupils } from "./pupils"
import PupilCard from './Components/PupilCard';

console.log(pupils)
const App = () => (
<div>
    <PupilCard 
        firstname={pupils.firstname} 
        surname={pupils.surname}
        photo={pupils.photo}
        behaviourPoints={pupils.behaviourPoints}
        assessmentOne={pupils.assessmentOne}
        assessmentTwo={pupils.assessmentTwo}
        assessmentThree={pupils.assessmentThree}  

     />

</div>)

ReactDOM.render(<App />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
